        if (stocks != null) {
            stocks.forEach(stock => {
                stockList.push(this.createStockInfo(stock, detail[k]["createTime"], record["type"], zlIdMap[record["zlId"]], detail[k]["title"],
                    record["type"], record["subjectId"]));
                stockList = stockList.sort(function(a,b){return b.time > a.time ? 1: -1});
            })
        }
        put.push("x");
        if (put.length === max) {
            this.setState({
                hackStockList: stockList,
                renderHackPage: true
            });
        }
    }

    createStockInfo(stock, time, from, zl, title, type, subjectId) {
        let o = new Object();
        o.stock = stock;
        o.time = time;
        o.from = from;
        o.zl = zl;
        o.title = title;
        o.type = type;
        o.subjectId = subjectId;
        return o;
    }

    renderHack() {
        var listElements=[];
        listElements.push(<button className="BackButton" onClick={() => this.exitHack()}>{"<"}返回</button>);
        listElements.push(<h4>股帮提及股票列表</h4>);
        let stockList = this.state.hackStockList;
        for(let i=0;i < stockList.length; i++) {
            let info = stockList[i];
            listElements.push(
                <p>
                    股票名称: {info.stock}； 股票代码: {allStockMap[info.stock]}； 提及时间: {info.time}； 来源: {info.zl} <br/>
                    <sub style={{color: "gray"}}>来自: {info.title}</sub><button className="NaviDetailBtn" onClick={() => this.clickDetail(info.type, info.subjectId)}>详情</button>
                    {this.renderSpecificStockPage(allStockMap[info.stock])}
                </p>
            )
        }
        return listElements;
    }

    exitHack() {
        this.setState({
            renderHackPage: false
        })
    }

    // -----------------------------------------------------------------

    renderStockPage() {
        let code = this.state.code;
        return(
            <div>
                <button className="BackButton" onClick={() => this.existStockPage()}>{"<"}返回</button>
                <br/>
                <GubangStockPage code={code} />
            </div>
        )
    }

    renderSpecificStockPage(code) {
        return(
            <div>
                <button className="BackButton" onClick={() => this.existStockPage()}>{"<"}返回</button>
                <br/>
                <GubangStockPage code={code} />
            </div>
        )
    }

    enterStockPage(code) {
        setTimeout(() => {
            this.setState({
                code: code,
                renderStockPage: true
            })
        }, 0)
    }

    existStockPage() {
        this.setState({
            renderStockPage: false
        })
    }

    nextPage() {
        let curPage = this.state.page + 1;
        this.setState({
            page: curPage
        });
        this.getList(curPage);
        this.refreshPageChanger(curPage)
    }

    prePage() {
        let curPage = this.state.page - 1;
        this.setState({
            page: curPage
        });
        this.getList(curPage);
        this.refreshPageChanger(curPage)
    }

    refreshPageChanger(curPage) {
        if (curPage === 1) {
            this.setState({needPre: false})
        } else {
            this.setState({needPre: true})
        }
    }

    renderPageChanger() {
        let result = [];
        if (this.state.needPre) {
            result.push(<button className="PageButton" onClick={() => this.prePage()}>上一页</button>)
        }
        if (this.state.needNext) {
            result.push(<button className="PageButton" onClick={() => this.nextPage()}>下一页</button>)
        }
        return result
    }

    handleFilter(e) {
        this.setState({
            page: 1
        });
        if (e.target.value === "全部") {
            this.setState({
                    renderZlIdList: false
            });
            this.getAllList(1)
        } else {
            this.setState({
                renderZlIdList: true,
                zlId: e.target.value
            });
            this.getZlIdList(1, e.target.value)
        }
    }

    render() {
        if (this.state.renderDetail) {
            return (
                <div className="PageDetail">
                    {this.renderDetail()}
                </div>
            )
        }
        if (this.state.renderStockPage) {
            return setTimeout(() => {
                return this.renderStockPage()
            }, 0)
            // return this.renderStockPage()
        }
        if (this.state.renderHackPage) {
            return (
                <div className="HackDetail">
                    {this.renderHack()}
                </div>
            )
        }
        return (
            <div>
                <button className="BackButton" onClick={() => this.getList(this.state.page)}>刷新</button>
                <select onChange={this.handleFilter}>
                    <option value="全部">全部</option>
                    <option value="1000003">独家研报</option>
                    <option value="1000004">游资锦囊</option>
                </select>
                <button className="BackButton" onClick={() => this.reptileStock()}>Hack</button>
                {this.renderList()}
                <div>
                    [第{this.state.page}页] {this.renderPageChanger()}
                </div>
            </div>
        );
    }

    componentDidMount(){
        this.timer=setInterval(()=>{ // 轮询
            this.compareAndRefreshAllList();
            if (this.state.needAlert) {
                this.setState({
                    needAlert: false
                });
                Notification.requestPermission();// 获取通知权限
                if (Notification.permission === "granted") {// denied (用户拒绝了通知的显示), granted (用户允许了通知的显示),
                    let notice = new Notification("Jarvis Notice", {
                        body : "股帮更新啦~",
                        silent:true,//通知是否静音，默认false，表示无声
                        renotify:false,//新通知是否覆盖旧的通知，默认为true，表示永远只显示一条通知；false不覆盖会多条通知叠加
                        requireInteraction: true, // 不自动关闭通知知道用户点击或关闭，默认false
                        sticky: true,//一个 Boolean 指明通知是否应该是“粘”, 即不易被用户清理。默认值为false，这意味着它不会粘。
                    });
                    notice.onshow = function () {
                        // do something
                    };
                    notice.onclick = function () {
                        window.focus();//这里是可以让浏览器到页面最顶层,并且浏览器显示消息页面tab(前提是当前页面没有关闭)
                        notice.close();
                    };
                    notice.onerror = function (err) {
                        // do something
                    };
                    notice.onclose = function () {
                        // do something
                    }
                }else if(Notification.permission === "denied"){
                    clearInterval(this.timer);
                }
            }
        },20000 + Math.floor(Math.random()*10000))
    }
    componentWillUnmount(){
        if(this.timer !== null) {
            clearInterval(this.timer);
        }
    }
}

class GubangStockPage extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            code: this.props.code,
            times: [],
            valueList: [],
            ma5: [],
            ma10: [],
            ma20: [],
            ma30: [],
            kTitle: "未知",
            type: "day"
        };
        this.getData(this.state.code, this.state.type);
        this.changeCode = this.changeCode.bind(this)
        this.changeType = this.changeType.bind(this)
    }

    loadStorage(key) {
        let storage=window.localStorage;
        if (storage.hasOwnProperty(key)) {
            console.log(key + ":" + storage[key]);
            return storage[key]
        }
        return null;
    }

    saveStorage(key, value) {
        let storage=window.localStorage;
        storage[key] = value
    }

    getTimes(kList) {
        let times = [];
        kList.forEach((raw) => {
            times.push(raw["time"])
        });
        return times.reverse();
    }

    getValueList(kList) {
        let list = [];
        kList.forEach((raw) => {
            list.push([
                parseFloat(raw["open"]),
                parseFloat(raw["close"]),
                parseFloat(raw["min"]),
                parseFloat(raw["max"])])
        });
        return list.reverse();
    }

    calculateMA(kList, dayCount) {
        let result = [];
        let valueList = this.getValueList(kList);
        for (let i = 0, len = valueList.length; i < len; i++) {
            if (i < dayCount) {
                result.push('-');
                continue;
            }
            let sum = 0;
            for (let j = 0; j < dayCount; j++) {
                sum += valueList[i - j][1];
            }
            result.push(sum / dayCount);
        }
        return result;
    }

    getTimeByType(type) {
        if (type === "week") {
            return moment().add("year", -1).format("yyyyMMDD");
        }
        if (type === "month") {
            return moment().add("year", -2).format("yyyyMMDD");
        }
        return moment().add("month", -6).format("yyyyMMDD");
    }

    async getData(code, type) {
        try {
            let begin = this.getTimeByType(type);
            let response = await fetch(dataUrl+"beginDay="+begin+"&code="+code+"&time="+type,
                {headers:{"Authorization":appCode}});
            let map = await response.json();
            let kList = map["showapi_res_body"]["dataList"];
            this.setState({
                times: this.getTimes(kList),
                valueList: this.getValueList(kList),
                ma5: this.calculateMA(kList, 5),
                ma10: this.calculateMA(kList, 10),
                ma20: this.calculateMA(kList, 20),
                ma30: this.calculateMA(kList, 30),
                kTitle: map["showapi_res_body"]["name"]
            });
        } catch(e) {
            console.log("Oops, error", e);
        }
    }

    changeCode(e) {
        this.setState({
            code: e.target.value
        });
        this.saveStorage("code", e.target.value);
        this.getData(e.target.value, this.state.type)
    }

    changeType(e) {
        this.setState({
            type: e.target.value
        });
        this.getData(this.state.code, e.target.value)
    }

    render(){
        return(
            <div className="GubangStockPage">
                <div className='StockDetail' style={{height:'45vh',width:'80vh'}}>
                    <div className="StockCodeInput">
                        股票代码 <input onBlur={this.changeCode} type='text'/>
                        <label><input name="timeType" type="radio" value="day" onClick={this.changeType} defaultChecked="checked"/>日K </label>
                        <label><input name="timeType" type="radio" value="week" onClick={this.changeType}/>周K </label>
                        <label><input name="timeType" type="radio" value="month" onClick={this.changeType}/>月K </label>
                    </div>
                    <div className="ChartColumn">
                        <ReactEcharts className="StockChart" option={this.getOption()} style={{height:'40vh',width:'60vh'}} theme="Imooc"/>
                    </div>
                </div>
            </div>
        )
    }

    getOption =()=> {
        let option = {
            title: {
                text: this.state.kTitle,
                left: 0
            },
            tooltip: {
                trigger: 'axis',
