                                type: 'max',
                                valueDim: 'close'
                            }
                        ]
                    }
                },
                {
                    name: 'MA5',
                    type: 'line',
                    data: this.state.ma5,
                    xAxisIndex: 0,
                    smooth: true,
                    lineStyle: {
                        opacity: 0.5
                    },
                    symbolSize: 0.5
                },
                {
                    name: 'MA10',
                    type: 'line',
                    data: this.state.ma10,
                    smooth: true,
                    lineStyle: {
                        opacity: 0.5
                    },
                    symbolSize: 0.5
                },
                {
                    name: 'MA20',
                    type: 'line',
                    data: this.state.ma20,
                    smooth: true,
                    lineStyle: {
                        opacity: 0.5
                    },
                    symbolSize: 0.5
                },
                {
                    name: 'MA30',
                    type: 'line',
                    data: this.state.ma30,
                    smooth: true,
                    lineStyle: {
                        opacity: 0.5
                    },
                    symbolSize: 0.5
                }/*,
                {
                    name: 'BI',
                    type: 'line',
                    data: biData,
                    smooth: false,
                    lineStyle: {
                        opacity: 1,
                        color: 'red'
                    },
                    symbolSize: 0.5,
                    connectNulls: true
                },
                {
                    name: 'XD',
                    type: 'line',
                    data: xdData,
                    smooth: false,
                    lineStyle: {
                        opacity: 1,
                        color: 'blue',
                        type:'dotted'
                    },
                    symbolSize: 0.5,
                    connectNulls: true
                },*/
            ]
        };
        return option
    }
}

export default GubangPage;
